import React from 'react';
import Blockquote from '../components/Blockquote/Blockquote';
import Button from '../components/Button/Button';
import Content from '../components/Content/Content';
import ContactForm from '../components/Form/Contact/ContactForm';
import Figure from '../components/Figure/Figure';
import Pagination from '../components/Pagination/Pagination';
import Increment from '../components/Increment/Increment';
import Layout from '../Layout/Layout';
import List from '../components/List/List';
import HandleChange from '../components/HandleChange/HandleChange';


const Components: React.FC = () => {
    return (
        <Layout page="Components">
            <Content header="button component">
                <List>
                <Button>Click</Button>
                <Button>Click 2</Button>
                <Button>Click 3</Button>
                </List>
            </Content>
            <Content header="figure component">
                <Figure/>
                <Figure/>
                <Figure/>
            </Content>
            <Content header="contact form component">
                <ContactForm title="contact form" class="contact-form"/>
            </Content>
            <Content header="blockquote component">
                <Blockquote>Im changing it</Blockquote>
                <Blockquote></Blockquote>
                <Blockquote></Blockquote>
            </Content>
            <Content header="pagination component">
                <Pagination pages={[4, 5, 6, 7, 8, 9]}>pagination</Pagination>
            </Content>
            <Content header="increment component">
                <Increment></Increment>
            </Content>
            <List>
                <span>9</span>
                <span>y</span>
                <span>10</span>
            </List>
            <List>
                <p>title</p>
                <Button>click here</Button>
                <b>bold content</b>
            </List>
        </Layout>
    )
};

export default Components;
